// page1.js
import React from "react";
import { useNavigate } from "react-router-dom";

function Page1() {
    const navigate = useNavigate();

    const goToBlogsPage = () => {
        navigate("/blogs");
    };

    return (
        <div>
            <h1>Hello here is page1</h1>
            <button onClick={goToBlogsPage}>Go to Blogs</button>
        </div>
    );
}

export default Page1;
